import React from 'react';

import styles from './TileItem.module.css';

export default ({ appointment_id, start_time, handleClick }) => {
	return (
  	<li className={styles.row}> 
			<div className={styles.text}>
					{appointment_id + '\t' + start_time.split('T')[0]}
			</div>
		</li>
	);
};

